export default (function(a,b,c,d,e,f,g,h){return {data:{"0djlNRNogD":{data:{id:1603,attributes:{imdbId:"tt1390411",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjA5NzUwODExM15BMl5BanBnXkFtZTgwNjM0MzE4NjE@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.9\u002F10"},{Source:"Rotten Tomatoes",Value:"43%"},{Source:"Metacritic",Value:"47\u002F100"}],item_lang:{data:{id:2266,attributes:{title:a,plot:"In the winter of 1820, the New England whaling ship Essex was assaulted by something no one could believe: a whale of mammoth size and will, and an almost human sense of vengeance. The real-life maritime disaster would inspire Herman Melville's Moby-Dick. But that told only half the story. \"In the Heart of the Sea\" reveals the encounter's harrowing aftermath, as the ship's surviving crew is pushed to their limits and forced to do the unthinkable to stay alive. Braving storms, starvation, panic and despair, the men will call into question their deepest beliefs, from the value of their lives to the morality of their trade, as their captain searches for direction on the open sea and his first mate still seeks to bring the great whale down.",slug:"in-the-heart-of-the-sea"}}},books:{data:[{id:8328,attributes:{title:a,description:d,thumbnail:e,authors:[b],firstBook:true,published:f,publisher:g,subtitle:h}},{id:8329,attributes:{title:a,description:"The riveting and critically acclaimed bestseller, soon to be a major motion picture directed by Ron Howard Chris Hemsworth, Cillian Murphy, Ben Whishaw, and Brendan Gleeson will star in a new film based on this National Book Award-winning account of the true events behind \"Moby Dick.\" In 1820, the whaleship \"Essex \"was rammed and sunk by an angry sperm whale, leaving the desperate crew to drift for more than ninety days in three tiny boats. Nathaniel Philbrick uses little-known documents and vivid details about the Nantucket whaling tradition to reveal the chilling facts of this infamous maritime disaster. \"In the Heart of the Sea\"--and now, its epic adaptation for the screen--will forever place the \"Essex \"tragedy in the American historical canon.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=RirWrQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2015-03-01",publisher:"William Collins",subtitle:"The Epic True Story That Inspired 'Moby Dick'"}},{id:8330,attributes:{title:"In the Heart of the Sea (Young Readers Edition)",description:"\"The incredible true story of the epic adventure and harrowing disaster that inspired Moby Dick\"--Back Cover.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ssweEAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2015-01-01",publisher:"Puffin",subtitle:"The True Story of the Whaleship Essex"}},{id:8331,attributes:{title:a,description:d,thumbnail:e,authors:[b],firstBook:c,published:f,publisher:g,subtitle:h}},{id:8332,attributes:{title:a,description:"The Number One best-selling, epic true-life story of one of the most notorious maritime disasters of the 19th century, beautifully reissued.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=zNdDExT9q4sC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2007-02-01",publisher:"HarperCollins UK",subtitle:"The Epic True Story That Inspired Moby Dick"}}]}}},meta:{}}},prerenderedAt:1680940968931}}("In the Heart of the Sea","Nathaniel Philbrick",null,"From the author of Mayflower, Valiant Ambition, and In the Hurricane's Eye--the riveting bestseller tells the story of the true events that inspired Melville's Moby-Dick. Winner of the National Book Award, Nathaniel Philbrick's book is a fantastic saga of survival and adventure, steeped in the lore of whaling, with deep resonance in American literature and history. In 1820, the whaleship Essex was rammed and sunk by an angry sperm whale, leaving the desperate crew to drift for more than ninety days in three tiny boats. Nathaniel Philbrick uses little-known documents and vivid details about the Nantucket whaling tradition to reveal the chilling facts of this infamous maritime disaster. In the Heart of the Sea, recently adapted into a major feature film starring Chris Hemsworth, is a book for the ages.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=jcarV199NhkC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2001-05-01","Penguin","The Tragedy of the Whaleship Essex"))